clip,\n","* smart watch,\n","* water bottle that tracks daily water intake.\n","\n","The activity, sleep, stress and other individual data are displayed in the Bellabeat app.\n","\n","Bellabeat also offers a subscription-based 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty.\n","\n","## 1.2. Goals and objectives of data analysis\n","\n","Bellabeat’s marketing analytics team is currently analyzing the available consumer data to reveal more opportunities for growth. I was tasked to analyze smart device usage data from several fitbit devices, in order to gain insight into how consumers use non-Bellabeat smart devices.\n","\n","The research questions below define the objectives of the study:\n","\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n","\n","The answers to these questions may help to identify the most commercially auspicious smart devices and help to improve the software functionality for a better user experience.\n","\n","## 1.3. Data quality\n","\n","The FitBit Fitness Tracker Data consists of 18 CSV files. Among them are duplicate datasets, organized in various (wide and long) formats. Effectively, there are 12 tables with unique data.\n","\n","The most significant limitation of this data is the number of unique users, being observed, which is 33 at best. Some types of measurement, such as sleep or weight data, include even less users, which is due to differences in types of devices, used by different participants of the study.\n","\n","There is not much metadata available - no information about the selection: Whether there was a proper randomization or whether the selection adequately represents the variety of population. Therefore, all results and recommendations of this study should be taken with a grain of salt. In a real-world situation one should look additionally for related openly available data, in order to evaluate and improve the representativeness of this study.\n","\n","The users in the FitBit Fitness Tracker Data are anonymous - they are identified by Id numbers. There is no information about age or gender of participants in this study.\n","\n","# 2. Preparing and cleaning the data\n","## 2.1. Loading relevant packages\n","\n","Tidyverse has some of the packages I need for this analysis. I was also planning to dive deeper into statistical methods of data analysis, therefore I added a couple of other relevant packages."]},{"cell_type":"code","execution_count":2,"id":"c9ab4661","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:09:55.838801Z","iopub.status.busy":"2023-05-01T15:09:55.807924Z","iopub.status.idle":"2023-05-01T15:09:58.776281Z","shell.execute_reply":"2023-05-01T15:09:58.773361Z"},"papermill":{"duration":2.986224,"end_time":"2023-05-01T15:09:58.779328","exception":false,"start_time":"2023-05-01T15:09:55.793104","status":"completed"},"tags":[]},"outputs":[],"source":["suppressMessages(\n","  suppressWarnings({\n","    library(tidyverse)\n","    library(lubridate)\n","    library(relaimpo)\n","    library(gridExtra)\n","    library(reshape2)\n","  })\n",")"]},{"cell_type":"markdown","id":"0d1169cb","metadata":{"papermill":{"duration":0.013476,"end_time":"2023-05-01T15:09:58.806415","exception":false,"start_time":"2023-05-01T15:09:58.792939","status":"completed"},"tags":[]},"source":["## 2.2. Reading the data\n","\n","I've chosen the relevant data."]},{"cell_type":"code","execution_count":3,"id":"520020c4","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:09:58.836622Z","iopub.status.busy":"2023-05-01T15:09:58.834311Z","iopub.status.idle":"2023-05-01T15:10:04.143958Z","shell.execute_reply":"2023-05-01T15:10:04.142274Z"},"papermill":{"duration":5.328049,"end_time":"2023-05-01T15:10:04.147635","exception":false,"start_time":"2023-05-01T15:09:58.819586","status":"completed"},"tags":[]},"outputs":[]