5-01T15:10:06.191769","status":"completed"},"tags":[]},"source":["There is a significant variation among average daily distance from user to user: With the minimum average distance of 0.6km and maximum of 13.2km, the overall average equals 5.4km. It falls short of the recommended daily walk distance, although it is not too far from that number.\n","This may signify that fitness is not the utmost priority for an average user, but it is among his/her priorities.\n","\n","### 3.1.2. Activity level\n","As we can see from the overall summary, an average user spends about 80% of his time sedentary and 20% relatively active. The light type of activity is the most predominant one, accounting for 78% among all activity types, excluding the sedentary. Assuming that the light types of activity mostly include normal daily activities, such as walking, shopping etc. We can assume that workouts account for about 12% of physically active time for an average user. To estimate the relative intensity ratio of workouts, we can compare the fairly active and very active minutes."]},{"cell_type":"code","execution_count":11,"id":"b9ddd141","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:06.240632Z","iopub.status.busy":"2023-05-01T15:10:06.238775Z","iopub.status.idle":"2023-05-01T15:10:06.296346Z","shell.execute_reply":"2023-05-01T15:10:06.294203Z"},"papermill":{"duration":0.077456,"end_time":"2023-05-01T15:10:06.299325","exception":false,"start_time":"2023-05-01T15:10:06.221869","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 1 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>avg_VeryActivePct</th><th scope=col>avg_FairlyActivePct</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>50.81642</td><td>49.18358</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 1 × 2\n","\\begin{tabular}{ll}\n"," avg\\_VeryActivePct & avg\\_FairlyActivePct\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 50.81642 & 49.18358\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 1 × 2\n","\n","| avg_VeryActivePct &lt;dbl&gt; | avg_FairlyActivePct &lt;dbl&gt; |\n","|---|---|\n","| 50.81642 | 49.18358 |\n","\n"],"text/plain":["  avg_VeryActivePct avg_FairlyActivePct\n","1 50.81642          49.18358           "]},"metadata":{},"output_type":"display_data"}],"source":["workouts_by_user <- dailyActivity %>%\n","  group_by(Id) %>%\n","  summarise(\n","    avg_VeryActiveMinutes = mean(VeryActiveMinutes, na.rm = TRUE),\n","    avg_FairlyActiveMinutes = mean(FairlyActiveMinutes, na.rm = TRUE),\n","    total_ActiveMinutes = sum(avg_VeryActiveMinutes + avg_FairlyActiveMinutes, na.rm = TRUE)\n","  ) %>%\n","  mutate(\n","    avg_VeryActivePct = ifelse(total_ActiveMinutes == 0, 0, avg_VeryActiveMinutes / total_ActiveMinutes * 100),\n","    avg_FairlyActivePct = ifelse(total_ActiveMinutes == 0, 0, avg_FairlyActiveMinutes / total_ActiveMinutes * 100)\n","  )\n","\n","workouts_summary <- workouts_by_user %>%\n","  summarise(\n","    avg_VeryActivePct = mean(avg_VeryActivePct),\n","    avg_FairlyActivePct = mean(avg_FairlyActivePct)\n","  )\n","\n","workouts_summary"]},{"cell_type":"markdown","id":"f21dbc1d","metadata":{"papermill":{"duration":0.015613,"end_time":"2023-05-01T15:10:06.330349","exception":false,"start_time":"2023-05-01T15:10:06.314736","status":"completed"},"tags":[]},"source":["Users tend to spend about 51% of their workouts on intense training and the rest of workout time on fairly intensive fitness activities.\n","\n","### 3.1.3. Heartrate, sleep duration and caloric expenditure\n","\n","Heart rate signifies the intensity level of daily activities. For a middle-aged healthy person activity levels can be categorized by heartrate approximately in the following way:\n","\n","- resting (< 60)\n","- sedentary (61-90)\n","- light (91-120)\n","- moderate (121-140)\n","- hard (141-160)\n","- max (>160)\n","\n","In order to count the number of heartrate values, falling under each of these categories for each individual user (Id), I created a new variable."]},{"cell_type":"code","execution_count":12,"id":"ececfc7a","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:06.367933Z","iopub.status.busy":"2023-05-01T15:10:06.36589Z","iopub.status.idle":"2023-05-01T15:10:08.870098Z","shell.execute_reply":"2023-05-01T15:10:08.868244Z"},"papermill":{"duration":2.525736,"end_time":"2023-05-01T15:10:08.872928","exception":false,"start_time":"2023-05-01T15:10:06.347192","status":"completed"},"tags":[]},"outputs":[],"source":["heartrate_categories <- heartrate_seconds %>%\n","  mutate(Category = case_when(\n","    Value < 60 ~ \"resting\",\n","    Value >= 60 & Value <= 90 ~ \"sedentary\",\n","    Value >= 91 & Value <= 120 ~ \"light\",\n","    Value >= 121 & Value <= 140 ~ \"moderate\",\n","    Value >= 141 & Value <= 160 ~ \"hard\",\n","    Value > 160 ~ \"max\"\n","  ))"]},{"cell_type":"markdown","id":"62c334f8","metadata":{"papermill":{"duration":0.015393,"end_time":"2023-05-01T15:10:08.904005","exception":false,"start_time":"2023-05-01T15:10:08.888612","status":"completed"},"tags":[]},"source":["Next, I counted the number of heartbeat values in each category for each Id."]},{"cell_type":"code","execution_count":13,"id":"5397d309","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:08.939309Z","iopub.status.busy":"2023-05-01T15:10:08.937747Z","iopub.status.idle":"2023-05-01T15:10:09.605329Z","shell.execute_reply":"2023-05-01T15:10:09.603621Z"},"papermill":{"duration":0.688716,"end_time":"2023-05-01T15:10:09.608335","exception":false,"start_time":"2023-05-01T15:10:08.919619","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'Id'. You can override using the `.groups`\n","argument.\n"]}],"source":["category_counts <- heartrate_categories %>%\n","  group_by(Id, Category) %>%\n","  summarise(Count = n()) %>%\n","  ungroup()"]},{"cell_type":"markdown","id":"308f956b","metadata":{"papermill":{"duration":0.015533,"end_time":"2023-05-01T15:10:09.682386","exception":false,"start_time":"2023-05-01T15:10:09.666853","status":"completed"},"tags":[]},"source":["I calculated the percentage ratio of each category for each user."]},{"cell_type":"code","execution_count":14,"id":"2f36b43b","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:09.717154Z","iopub.status.busy":"2023-05-01T15:10:09.71567Z","iopub.status.idle":"2023-05-01T15:10:09.7516Z","shell.execute_reply":"2023-05-01T15:10:09.74984Z"},"papermill":{"duration":0.056559,"end_time":"2023-05-01T15:10:09.754572","exception":false,"start_time":"2023-05-01T15:10:09.698013","status":"completed"},"tags":[]},"outputs":[],"source":["category_counts <- category_counts %>%\n","  group_by(Id) %>%\n","  mutate(Total = sum(Count),\n","         Percentage = (Count / Total) * 100) %>%\n","  replace_na(list(sedentary = 0, resting = 0, light = 0, moderate = 0, hard = 0, max = 0)) %>%\n","  ungroup()\n","\n","category_counts <- category_counts %>%\n","  mutate(Category = factor(Category, levels = c(\"max\", \"hard\", \"moderate\", \"light\", \"sedentary\", \"resting\")))"]},{"cell_type":"markdown","id":"6dade189","metadata":{"papermill":{"duration":0.015416,"end_time":"2023-05-01T15:10:09.785189","exception":false,"start_time":"2023-05-01T15:10:09.769773","status":"completed"},"tags":[]},"source":["I ordered the categories in the proper sequence."]},{"cell_type":"code","execution_count":15,"id":"50c5ac86","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:09.820202Z","iopub.status.busy":"2023-05-01T15:10:09.818639Z","iopub.status.idle":"2023-05-01T15:10:09.834519Z","shell.execute_reply":"2023-05-01T15:10:09.832759Z"},"papermill":{"duration":0.037317,"end_time":"2023-05-01T15:10:09.83794","exception":false,"start_time":"2023-05-01T15:10:09.800623","status":"completed"},"tags":[]},"outputs":[],"source":["category_counts$Category <- factor(category_counts$Category,\n","                                   levels = c(\"max\", \"hard\", \"moderate\", \"light\", \"sedentary\", \"resting\"))"]},{"cell_type":"markdown","id":"cf271377","metadata":{"papermill":{"duration":0.015573,"end_time":"2023-05-01T15:10:09.869752","exception":false,"start_time":"2023-05-01T15:10:09.854179","status":"completed"},"tags":[]},"source":["Then, I deleted the unnecessary variables and transformed the data into wide format, while keeping the long data for a plot."]},{"cell_type":"code","execution_count":16,"id":"036c39f8","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:09.905621Z","iopub.status.busy":"2023-05-01T15:10:09.903993Z","iopub.status.idle":"2023-05-01T15:10:09.947Z","shell.execute_reply":"2023-05-01T15:10:09.945257Z"},"papermill":{"duration":0.063967,"end_time":"2023-05-01T15:10:09.950274","exception":false,"start_time":"2023-05-01T15:10:09.886307","status":"completed"},"tags":[]},"outputs":[],"source":["category_counts_wide <- category_counts %>%\n","  dplyr::select(-Count, -Total) %>%\n","  pivot_wider(names_from = Category, values_from = Percentage) %>%\n","  dplyr::select(Id, resting, sedentary, light, moderate, hard, max)"]},{"cell_type":"markdown","id":"5f658a6d","metadata":{"papermill":{"duration":0.015709,"end_time":"2023-05-01T15:10:09.981179","exception":false,"start_time":"2023-05-01T15:10:09.96547","status":"completed"},"tags":[]},"source":["I calculated the averages in sleep data, in order to have it adequately joined with the heartbeat data."]},{"cell_type":"code","execution_count":17,"id":"993fd19d","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:10.017651Z","iopub.status.busy":"2023-05-01T15:10:10.016027Z","iopub.status.idle":"2023-05-01T15:10:10.039019Z","shell.execute_reply":"2023-05-01T15:10:10.037287Z"},"papermill":{"duration":0.044837,"end_time":"2023-05-01T15:10:10.042141","exception":false,"start_time":"2023-05-01T15:10:09.997304","status":"completed"},"tags":[]},"outputs":[],"source":["average_daily_sleep <- dailySleep %>%\n","  group_by(Id) %>%\n","  summarise(\n","    AvgTotalSleepRecords = mean(TotalSleepRecords),\n","    AvgTotalMinutesAsleep = mean(TotalMinutesAsleep),\n","    AvgTotalTimeInBed = mean(TotalTimeInBed)\n","  ) %>%\n","  ungroup()"]},{"cell_type":"markdown","id":"bf8b8cf2","metadata":{"papermill":{"duration":0.015435,"end_time":"2023-05-01T15:10:10.073035","exception":false,"start_time":"2023-05-01T15:10:10.0576","status":"completed"},"tags":[]},"source":["I joined it with the previously created dataframes."]},{"cell_type":"code","execution_count":18,"id":"beff50e3","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:10.107817Z","iopub.status.busy":"2023-05-01T15:10:10.106295Z","iopub.status.idle":"2023-05-01T15:10:10.133334Z","shell.execute_reply":"2023-05-01T15:10:10.131562Z"},"papermill":{"duration":0.048153,"end_time":"2023-05-01T15:10:10.136756","exception":false,"start_time":"2023-05-01T15:10:10.088603","status":"completed"},"tags":[]},"outputs":[],"source":["combined_df <- category_counts_wide %>%\n","  left_join(workouts_by_user, by = \"Id\") %>%\n","  left_join(summary_by_id, by = \"Id\") %>% \n","  left_join(average_daily_sleep, by = \"Id\")"]},{"cell_type":"markdown","id":"ca9553e8","metadata":{"papermill":{"duration":0.015525,"end_time":"2023-05-01T15:10:10.167811","exception":false,"start_time":"2023-05-01T15:10:10.152286","status":"completed"},"tags":[]},"source":["I decided to add the BMI (body mass index) data for each user, based on the first data entry for each user in the weightLogInfo dataframe. The BMI should be displayed in place of user Id labels, where possible."]},{"cell_type":"code","execution_count":19,"id":"6fe192a6","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:10.202241Z","iopub.status.busy":"2023-05-01T15:10:10.200713Z","iopub.status.idle":"2023-05-01T15:10:10.263257Z","shell.execute_reply":"2023-05-01T15:10:10.261389Z"},"papermill":{"duration":0.083286,"end_time":"2023-05-01T15:10:10.266496","exception":false,"start_time":"2023-05-01T15:10:10.18321","status":"completed"},"tags":[]},"outputs":[],"source":["first_bmi <- weightLogInfo %>% \n","  arrange(Id, Date) %>% \n","  group_by(Id) %>% \n","  slice(1) %>% \n","  ungroup()\n","\n","# Create a mapping between User ID and corresponding BMI value or user number\n","id_bmi_mapping <- full_join(\n","  data.frame(Id = unique(category_counts$Id)),\n","  first_bmi[, c(\"Id\", \"BMI\")],\n","  by = \"Id\"\n",")\n","\n","id_bmi_mapping$label <- ifelse(\n","  is.na(id_bmi_mapping$BMI),\n","  paste0(\"User\", seq_along(id_bmi_mapping$Id)),\n","  round(id_bmi_mapping$BMI, 1)\n",")\n","\n","# Generate user numbers for users with missing BMI values\n","missing_bmi_count <- 0\n","id_bmi_mapping$user_number <- NA\n","id_bmi_mapping$user_number[is.na(id_bmi_mapping$BMI)] <- seq_along(id_bmi_mapping$Id[is.na(id_bmi_mapping$BMI)])\n","\n","# Create a factor variable with the desired order for the labels\n","id_bmi_mapping <- id_bmi_mapping %>%\n","  mutate(\n","    label = ifelse(\n","      is.na(BMI),\n","      paste0(\"User\", user_number),\n","      round(BMI, 1)\n","    ),\n","    label = factor(label, levels = unique(label))\n","  )\n","# Add the labels to category_counts and combined_df\n","category_counts <- left_join(category_counts, id_bmi_mapping, by = \"Id\")\n","combined_df <- left_join(combined_df, id_bmi_mapping, by = \"Id\")"]},{"cell_type":"markdown","id":"fd1f91c4","metadata":{"papermill":{"duration":0.015276,"end_time":"2023-05-01T15:10:10.297163","exception":false,"start_time":"2023-05-01T15:10:10.281887","status":"completed"},"tags":[]},"source":["Preparing the plot, I rescaled the average calories and sleep duration variables to fit them into the stacked bar plot."]},{"cell_type":"code","execution_count":20,"id":"9e7affa7","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:10.331682Z","iopub.status.busy":"2023-05-01T15:10:10.33017Z","iopub.status.idle":"2023-05-01T15:10:10.347577Z","shell.execute_reply":"2023-05-01T15:10:10.345823Z"},"papermill":{"duration":0.038027,"end_time":"2023-05-01T15:10:10.350577","exception":false,"start_time":"2023-05-01T15:10:10.31255","status":"completed"},"tags":[]},"outputs":[],"source":["combined_df$rescaled_Calories <- combined_df$avg_Calories / 40\n","\n","combined_df$rescaled_Sleep <- combined_df$AvgTotalMinutesAsleep / 4"]},{"cell_type":"markdown","id":"88d06739","metadata":{"papermill":{"duration":0.015138,"end_time":"2023-05-01T15:10:10.38094","exception":false,"start_time":"2023-05-01T15:10:10.365802","status":"completed"},"tags":[]},"source":["Finally, I created a plot with two facets. The stacked bars demonstrate the ratio of different activity levels by heart beat. Wherever applicable, user Ids have been replaced with the BMI score as an additional variable in the plot. The blue line on the upper facet shows average calorie expenditure of users. The red line on the lower facet stands for their average sleep duration."]},{"cell_type":"code","execution_count":21,"id":"79e1dd94","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:10.415149Z","iopub.status.busy":"2023-05-01T15:10:10.413556Z","iopub.status.idle":"2023-05-01T15:10:11.48297Z","shell.execute_reply":"2023-05-01T15:10:11.480052Z"},"papermill":{"duration":1.090598,"end_time":"2023-05-01T15:10:11.486768","exception":false,"start_time":"2023-05-01T15:10:10.39617","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22mRemoved 2 rows containing missing values (`geom_line()`).”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddUAT7xsA8PcWbHQ3IigCIoiiYgKCgYWCBdjdgWDwtTsRFbsLE7sVUTBQUTER\nRMQkRaQZjO1+f8zfdhs1kO3GeD5/ce/u7n3udnAPd29gOI4jAAAAAABQ/1HIDgAAAAAAANQN\nSOwAAAAAAOQEJHYAAAAAAHI