= 1)) +\n","  labs(title = \"Heartbeat Intensity - Sleep Duration\",\n","       x = \"User BMI / User Number\",\n","       y = \"Percentage\") +\n","  guides(fill = guide_legend(title = \"Intensity\")) +\n","  geom_line(data = combined_df, aes(x = label, y = rescaled_Sleep, group = 1), color = \"red\", linewidth = 1) +\n","  scale_y_continuous(sec.axis = sec_axis(~ . * 4, name = \"Average Total Sleep\"))\n","\n","grid.arrange(p1, p2, ncol = 1)"]},{"cell_type":"markdown","id":"9f13b73a","metadata":{"papermill":{"duration":0.019585,"end_time":"2023-05-01T15:10:11.525852","exception":false,"start_time":"2023-05-01T15:10:11.506267","status":"completed"},"tags":[]},"source":["Key insights:\n","\n","* Resting heartbeat seems to correlate negatively with sleep duration and caloric expenditure.\n","* Some users with lower rate of resting heartbeat do get enough sleep. The low resting heartbeat rate in this people can be due to a generally higher heartbeat rate - it is, probably higher than 60 per minute, even when they sleep. The reason could be health issues or the lack of exercise, as can be concluded from their general breathing patterns.\n","* The observed trends don't appear to be significantly influenced by BMI body mass ratio, albeit the amount of the available BMI data here is clearly not representative.\n","* Only one user out of 14 shows relatively high level of intensive physical activity, having also good BMI and breathing patterns.\n","* In general, both exercise and having enough sleep seem to impact the caloric expenditure.\n","\n","## 3.2. Comparing various predictors for caloric expenditure and sleep quality\n","### 3.2.1. Total steps vs total distance\n","\n","Number of steps and the distance, walked during a day, are almost identical variables. I found it interesting to examine, which one is a better predictor for important outcomes, such as caloric expenditure or sleep quality and duration, and why.\n","\n","In this part of analysis I applied correlation and regression models.\n","\n","I fitted a multiple linear regression model with calories as dependent variable and steps and distance as two independent variables."]},{"cell_type":"code","execution_count":22,"id":"91b3b332","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:11.566308Z","iopub.status.busy":"2023-05-01T15:10:11.564679Z","iopub.status.idle":"2023-05-01T15:10:11.585224Z","shell.execute_reply":"2023-05-01T15:10:11.583273Z"},"papermill":{"duration":0.044198,"end_time":"2023-05-01T15:10:11.588392","exception":false,"start_time":"2023-05-01T15:10:11.544194","status":"completed"},"tags":[]},"outputs":[],"source":["calories_model <- lm(Calories ~ TotalSteps + TotalDistance, data = dailyActivity)"]},{"cell_type":"markdown","id":"1171ba65","metadata":{"papermill":{"duration":0.018195,"end_time":"2023-05-01T15:10:11.624752","exception":false,"start_time":"2023-05-01T15:10:11.606557","status":"completed"},"tags":[]},"source":["I calculated the relative importance of the predictors using the Lindeman, Merenda and Gold (LMG) method."]},{"cell_type":"code","execution_count":23,"id":"c88596de","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:11.665297Z","iopub.status.busy":"2023-05-01T15:10:11.66348Z","iopub.status.idle":"2023-05-01T15:10:11.740667Z","shell.execute_reply":"2023-05-01T15:10:11.738389Z"},"papermill":{"duration":0.100551,"end_time":"2023-05-01T15:10:11.743512","exception":false,"start_time":"2023-05-01T15:10:11.642961","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["Response variable: Calories \n","Total response variance: 515763.6 \n","Analysis based on 940 observations \n","\n","2 Regressors: \n","TotalSteps TotalDistance \n","Proportion of variance explained by model: 48.25%\n","Metrics are normalized to sum to 100% (rela=TRUE). \n","\n","Relative importance metrics: \n","\n","                    lmg\n","TotalSteps    0.4315815\n","TotalDistance 0.5684185\n","\n","Average coefficients for different model sizes: \n","\n","                        1X         2Xs\n","TotalSteps      0.08351327  -0.2136296\n","TotalDistance 118.02210357 390.8814157"]},"metadata":{},"output_type":"display_data"}],"source":["relative_importance <- calc.relimp(calories_model, type = \"lmg\", rela = TRUE)\n","relative_importance"]},{"cell_type":"markdown","id":"f5a28226","metadata":{"papermill":{"duration":0.018149,"end_time":"2023-05-01T15:10:11.780099","exception":false,"start_time":"2023-05-01T15:10:11.76195","status":"completed"},"tags":[]},"source":["It appears that distance is a better predictor for caloric expenditure than steps. However, if you check the regression results, you may notice the negative coefficient for Total steps."]},{"cell_type":"code","execution_count":24,"id":"2709c942","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:11.821052Z","iopub.status.busy":"2023-05-01T15:10:11.819316Z","iopub.status.idle":"2023-05-01T15:10:11.838318Z","shell.execute_reply":"2023-05-01T15:10:11.836196Z"},"papermill":{"duration":0.042452,"end_time":"2023-05-01T15:10:11.841102","exception":false,"start_time":"2023-05-01T15:10:11.79865","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = Calories ~ TotalSteps + TotalDistance, data = dailyActivity)\n","\n","Coefficients:\n","  (Intercept)     TotalSteps  TotalDistance  \n","    1789.4707        -0.2136       390.8814  \n"]},"metadata":{},"output_type":"display_data"}],"source":["calories_model"]},{"cell_type":"markdown","id":"bb428053","metadata":{"papermill":{"duration":0.018344,"end_time":"2023-05-01T15:10:11.877334","exception":false,"start_time":"2023-05-01T15:10:11.85899","status":"completed"},"tags":[]},"source":["There is an issue of multicollinearity at work here, because distance and steps are, obviously, highly correlated variables. To handle it I performed Ridge regression on the dataset, ultimately getting similar results.\n","\n","I will spare the detailed description of Ridge regression, which would go beyond the scope of basic data analysis. But I should explain, why I believe that this result holds true: The negative coefficient for TotalSteps suggests that, holding TotalDistance constant, an increase in the number of steps is associated with a decrease in the predicted calories burned. However, the positive coefficient for TotalDistance indicates that when the total distance increases, the predicted calories burned also increase. In this case, the TotalDistance variable seems to have a stronger influence on the predicted calories burned than the TotalSteps variable.\n","\n","All in all, bigger steps help to burn more calories for same distance, which may suggest that more intensive activities, like sprinting, essentially help to burn more calories than lighter types of activities, such as walking or jogging for same distances.\n","\n","\n","### 3.2.2. Comparing the impact of VeryActiveMinutes, FairlyActiveMinutes, LightlyActiveMinutes, and SedentaryMinutes on Calories\n","\n","To check the validity of my previous conclusion, I compared the impact of different activity levels on caloric expenditure."]},{"cell_type":"code","execution_count":25,"id":"a21bdc61","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:11.917369Z","iopub.status.busy":"2023-05-01T15:10:11.915698Z","iopub.status.idle":"2023-05-01T15:10:11.939182Z","shell.execute_reply":"2023-05-01T15:10:11.936959Z"},"papermill":{"duration":0.046678,"end_time":"2023-05-01T15:10:11.941972","exception":false,"start_time":"2023-05-01T15:10:11.895294","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = Calories ~ VeryActiveMinutes + FairlyActiveMinutes + \n","    LightlyActiveMinutes + SedentaryMinutes, data = dailyActivity)\n","\n","Coefficients:\n","         (Intercept)     VeryActiveMinutes   FairlyActiveMinutes  \n","           1241.1226               12.9543                3.6757  \n","LightlyActiveMinutes      SedentaryMinutes  \n","              2.0104                0.3539  \n"]},"metadata":{},"output_type":"display_data"}],"source":["time_calories_model <- lm(Calories ~ VeryActiveMinutes + FairlyActiveMinutes + LightlyActiveMinutes + SedentaryMinutes, data = dailyActivity)\n","\n","time_calories_model"]},{"cell_type":"markdown","id":"440742fb","metadata":{"papermill":{"duration":0.018726,"end_time":"2023-05-01T15:10:11.978778","exception":false,"start_time":"2023-05-01T15:10:11.960052","status":"completed"},"tags":[]},"source":["I also calculated the relative importance of predictors using the LMG method."]},{"cell_type":"code","execution_count":26,"id":"ad72d9dd","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:12.019572Z","iopub.status.busy":"2023-05-01T15:10:12.017692Z","iopub.status.idle":"2023-05-01T15:10:12.136134Z","shell.execute_reply":"2023-05-01T15:10:12.131845Z"},"papermill":{"duration":0.143757,"end_time":"2023-05-01T15:10:12.140916","exception":false,"start_time":"2023-05-01T15:10:11.997159","status":"completed"},"tags":[]},"outputs":[],"source":["relative_importance2 <- calc.relimp(time_calories_model, type = \"lmg\", rela = TRUE)"]},{"cell_type":"markdown","id":"5e6f2c42","metadata":{"papermill":{"duration":0.045363,"end_time":"2023-05-01T15:10:12.231357","exception":false,"start_time":"2023-05-01T15:10:12.185994","status":"completed"},"tags":[]},"source":["To visualize the results, I first converted the data into a tidy format."]},{"cell_type":"code","execution_count":27,"id":"b40d48e7","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:12.28073Z","iopub.status.busy":"2023-05-01T15:10:12.279256Z","iopub.status.idle":"2023-05-01T15:10:12.302704Z","shell.execute_reply":"2023-05-01T15:10:12.300741Z"},"papermill":{"duration":0.047967,"end_time":"2023-05-01T15:10:12.305751","exception":false,"start_time":"2023-05-01T15:10:12.257784","status":"completed"},"tags":[]},"outputs":[],"source":["relative_importance_tidy <- as.data.frame