tio of time being asleep to the total time in bed has shown some noticeable correlation with the caloric expenditure. Keep in mind that the correlation coefficient is much lower between this ratio and daily distance or highly intensive activities. Therefore, my conclusion is that the sleep quality correlates in itself with higher caloric expenditure and it is not necessarily dependent on the level of physical activity during the day.\n","\n","### 3.2.4. Impact of MET\n","Finally, in order to see the full picture, I added the MET values to the previous correlation matrix. MET usually stands for metabolic equivalent of task, which roughly translates into the energy expenditure rate for various activities."]},{"cell_type":"code","execution_count":33,"id":"c07660c5","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:13.112266Z","iopub.status.busy":"2023-05-01T15:10:13.110753Z","iopub.status.idle":"2023-05-01T15:10:13.145404Z","shell.execute_reply":"2023-05-01T15:10:13.143489Z"},"papermill":{"duration":0.058831,"end_time":"2023-05-01T15:10:13.148","exception":false,"start_time":"2023-05-01T15:10:13.089169","status":"completed"},"tags":[]},"outputs":[],"source":["METs_total <- minuteMET %>%\n","  group_by(Id) %>%\n","  summarise(TotalMETs = sum(METs)) %>%\n","  ungroup()"]},{"cell_type":"markdown","id":"b3607ac3","metadata":{"papermill":{"duration":0.01961,"end_time":"2023-05-01T15:10:13.186914","exception":false,"start_time":"2023-05-01T15:10:13.167304","status":"completed"},"tags":[]},"source":["I added the MET values to the summary."]},{"cell_type":"code","execution_count":34,"id":"bf0bd126","metadata":{"execution":{"iopub.execute_input":"2023-05-01T15:10:13.229641Z","iopub.status.busy":"2023-05-01T15:10:13.22797Z","iopub.status.idle":"2023-05-01T15:10:13.244884Z","shell.execute_reply":"2023-05-01T15:10:13.243032Z"},"papermill":{"duration":0.041133,"end_time":"2023-05-01T15:10:13.247465","exception":false,"start_time":"2023-05-01T15:10:13.206332","status"