 total daily MET. It essentially means that to burn more calories one should strive less for the volume, more for intensity of workout.\n","* When it comes to ratio of sleep duration to the time, spent in bed, it correlates most remarkably with the caloric expenditure. Since the correlation with intense activity, distance and MET is significantly lower, I tend to believe that the mechanism of correlation between the mentioned ratio and calories is not exclusively bound to these variables. Although, the matrix does not show the causation, we can preliminarily assume that good sleep helps to burn more calories.\n","\n","# 4. Conclusion and recommendations\n","\n","The selection, analyzed in this case study, represents regular working people, who have other priorities in life, besides fitness and workout. Still, these people are trying to maintain healthy life stile. Normally, fitness trackers are associated with sporty appearance, which may be less appealing to these people. Therefore my first recommendation would be, to design new fitness tracker models, looking less casual and more appropriate for daily business activities.\n","\n","Many users don't appear to do regular workouts, but they are probably mindful of their general health. Therefore, the company should focus on developing software features to help improve sleep quality, which will ultimately lead to higher caloric expenditure and better quality of life. Calming audio stimulation for falling asleep faster and alarm clock, which adapts to the sleeping patterns, in order to avoid disturbing essential sleep cycles, could be useful additions to the Bellabeat app.\n","\n","Finally, for those of users, who are likely more engaged in sports, the app should add high-intensity interval training recommendations. The hardware should also be adapted accordingly to endure intense fast movements with all body parts."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":22.19068,"end_time":"2023-05-01T15:10:14.059987","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-05-01T15:09:51.869307","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}